import style from "./Menu.module.css";

function Menu(props) {
  return (
    <>
      <input className={style.checkbox} id="nav__toggle" type="checkbox" />

      <label className={style.menu} htmlFor="nav__toggle" id="toggle-button">
        <span className={style["menu__icon"]}></span>
      </label>
    </>
  );
}

export default Menu;
